// src/components/CadastroForm.js
import React from 'react';
import { Link } from 'react-router-dom';
import './CadastroForm.css'; // Ajuste o caminho se necessário

const CadastroForm = () => {
    return (
        <div className="form-container">
            <h2>Cadastro de Usuário</h2>
            {/* Aqui pode estar o seu formulário de cadastro */}
            <form>
                {/* Campos do formulário de cadastro */}
                <button type="submit">Cadastrar Usuário</button>
            </form>
            {/* Botão para acessar a criação de produtos */}
            <Link to="/cadastrar-produto" className="button">Cadastrar Produto</Link>
            <Link to="/usuarios" className="button">Listar Usuários</Link>
            <Link to="/produtos" className="button">Listar Produtos</Link>
        </div>
    );
};

export default CadastroForm;
